import './QueueDriver.css'

export default function QueueDriver(props) {
    
    return(
        <div className="queue-container">
            <h4>ตารางคิว</h4>
            <div className="button-queue">
                <button className="button-enQueue" > เข้าคิว </button>
                <button className="button-leaveQueue"> ออกคิว </button>
            </div>
        </div>
    )
}
